import React from 'react';
import logo from './logo.svg';
import './App.css';
import Navbar from './components/Navbar'

function Home() {
  return (
    <div className="home-container">
      <Navbar/>
      <div className="welcome-header">
        <p> Infinite Memories.</p>
        <p> Zero Stress. </p>
      </div>
      <div className="welcome-body">
        Use our <b>All-in-One Trip Planner</b> to save time and simplify your booking process.
      </div>
      <button className="btn active welcome-btn">
        Get Started
      </button>
    </div>
  );
}

export default Home;
